import React, { useState } from "react";
import styles from "./index.module.scss";
import TextField from "@material-ui/core/TextField";
import MenuItem from "@material-ui/core/MenuItem";
import Select from "@material-ui/core/Select";
import FormControl from "@material-ui/core/FormControl";
import InputLabel from "@material-ui/core/InputLabel";

function StartPollForm() {
  const [roomName, setRoomName] = useState("");
  const [series, setSeries] = useState([]);
  const [allCanSee, setAllCanSee] = useState(false);

  const handleSeriesSelect = (event) => {
    setSeries(event.target.value);
  };

  const SERIES = [
    ["0", "1", "2", "3", "5", "8", "13", "21"],
    ["0", "1/2", "1", "2", "3", "5", "8", "13"],
  ];
  return (
    <div className={styles.pollform}>
      Start New Game
      <div className={styles.form}>
        <div className={styles.formField}>
          <TextField
            id="outlined-basic"
            label="Enter Game's Name"
            variant="outlined"
            onChange={(e) => setRoomName(e.target.value)}
            fullWidth
          />
        </div>
        <div className={styles.formField}>
          <FormControl variant="outlined" fullWidth>
            <InputLabel id="demo-customized-select-label">Series</InputLabel>
            <Select
              labelId="demo-simple-select-outlined-label"
              id="demo-simple-select-outlined"
              label="Series"
              onChange={handleSeriesSelect}
              fullWidth
            >
              <MenuItem value={10}>
                {SERIES[0].map((entry) => `${entry}, `)}
              </MenuItem>
              <MenuItem value={20}>
                {SERIES[1].map((entry) => `${entry}, `)}
              </MenuItem>
            </Select>
          </FormControl>
        </div>
        <div className={styles.formField}>
          <FormControl variant="outlined" fullWidth>
            <InputLabel id="demo-customized-select-label">
              Who can show cards?
            </InputLabel>
            <Select
              labelId="demo-simple-select-outlined-label"
              id="demo-simple-select-outlined"
              label="Who can view results?"
              fullWidth
            >
              <MenuItem value={20}>Twenty</MenuItem>
              <MenuItem value={30}>Thirty</MenuItem>
            </Select>
          </FormControl>
        </div>
      </div>
    </div>
  );
}

export default StartPollForm;
